import React from "react";
import { Segment, Form, Select, Input, FormTextArea } from "semantic-ui-react";

function Upload() {
  const options = [
    { key: "w", text: "Website", value: "website" },
    { key: "d", text: "Window Application", value: "window application" },
    { key: "a", text: "Android Application", value: "android application" }
  ];

  return (
    <Form>
      <Form.Field
        control={Select}
        label="Project Type"
        option={options}
        placeholder="Project Type"
        width={4}
      />
      <Form.Field control={Input} label="Title" placeholder="title" width={4} />
      <Form.Group widths="equal">
        <Form.Field
          control={Select}
          label="Language"
          placeholder="title"
          width={4}
        />
        <Form.Field
          control={Select}
          label="Version"
          placeholder="title"
          width={4}
        />
      </Form.Group>
      <Form.Group>
        <Form.Field
          control={Select}
          label="Database"
          placeholder="title"
          width={4}
        />
        <Form.Field
          control={Select}
          label="Version"
          placeholder="title"
          width={4}
        />
      </Form.Group>
    </Form>
  );
}

export default Upload;
